{key with spaces} {value with spaces}
key{brace} val{brace}
{a	b} {c
d}

tests.script:
# Test: dict filter script - break
set d [dict create a 1 b 2 c 3 d 4 e 5]
puts [dict filter $d script {k v} {
    if {$v > 3} break
    expr {$v % 2 == 1}
}]

# Test: dict for - basic iteration
set d [dict create a 1 b 2 c 3]
dict for {k v} $d {
    puts "$k=$v"
}

# Test: dict for - empty dict
dict for {k v} {} {
    puts "should not print"
}
puts "done"

# Test: dict for - continue
set d [dict create a 1 b 2 c 3]
dict for {k v} $d {
    if {$k eq "b"} continue
    puts "$k=$v"
}

# Test: dict for - result is empty string
set d [dict create a 1 b 2]
set result [dict for {k v} $d {
    puts "$k=$v"
}]
puts "result=<$result>"

# Test: dict map - break
set d [dict create a 1 b 2 c 3 d 4]
puts [dict map {k v} $d {
    if {$v > 2} break
    expr {$v * 10}
}]

# Test: dict map - continue skips entry
set d [dict create a 1 b 2 c 3]
puts [dict map {k v} $d {
    if {$k eq "b"} continue
    expr {$v * 10}
}]

# Test: dict update - unset variable removes key
set d [dict create a 1 b 2]
dict update d a x b y {
    unset x
}
puts $d

# Test: dict update - add new variable creates key
set d [dict create a 1]
dict update d a x b y {
    set y 2
}
puts $d

# Test: dict with - unset removes key
set d [dict create a 1 b 2]
dict with d {
    unset a
}
puts $d

# Test: dict with - add new variable creates key
set d [dict create a 1]
dict with d {
    set b 2
}
puts $d

# Test: dict with - empty dict
set d [dict create]
dict with d {
    set a 1
}
puts $d
